import React, { useState, Fragment } from 'react'

const Formulario = () => {
  return ( 
    <Fragment>
      <h1>Formulario</h1>
      <form className='row'>
        <div className='col-md-3'>
          <input  placeholder='Ingresar Nombre y Apellido'/>
        </div>
        <div className='col-md-3'>
          <input placeholder='Ingresar dni' type='number'/>
        </div>
        <div className='col-md-3'>
          <button className='btn btn-primary' type='submit'>Enviar</button>
        </div>

      </form>
    </Fragment>
  );
}
 
export default Formulario;
